import './Ptt.css';

export default function Display({ id, channel, message, isWarning, warningMessage }) {
  return (
    <div className='message-container'>
      <p className='message-id'>{id}</p>
      <p className='message-channel'>{channel}</p>
      <p className='message-talker'>{message}</p>
      { isWarning &&
          <p className='message-warnings'>{warningMessage}</p>
      }
    </div>
  );
}
